import { FETCH_ALL_BREEDS } from '../actions/types';

export default (state = {}, action) => {
    switch(action.type) {
        case FETCH_ALL_BREEDS: 
            console.log('here');
            return { ...state, ...action.payload };
        default:
            return state;
    }
}
